pragma solidity ^0.8.24;
import "hardhat/console.sol";

interface StableSwapPool {
    function balances(uint256 i_coin) external view returns (uint256);

    function coins(uint256 i) external view returns (address);

    function get_virtual_price() external view returns (uint256);

    function balanceOf(address arg0) external view returns (uint256);

    function add_liquidity(
        uint256[2] memory amounts,
        uint256 min_mint_amount
    ) external;

    function remove_liquidity_imbalance(
        uint256[2] memory amounts,
        uint256 max_burn_amount
    ) external;

    function calc_token_amount(
        uint256[2] memory amounts,
        bool is_deposit
    ) external view returns (uint256);
}

interface IStableSwapLP {
    function balanceOf(address account) external view returns (uint256);

    function transfer(
        address recipient,
        uint256 amount
    ) external returns (bool);
}

interface ERC20 {
    function approve(address _spender, uint256 _amount) external;

    function decimals() external view returns (uint256);
}

interface StableAggregator {
    function price() external view returns (uint256);
}

contract PegKeeperV1 {
    event Provide(uint256 amount);
    event Withdraw(uint256 amount);
    event Profit(uint256 lp_amount);
    event CommitNewReceiver(address newReceiver);
    event ApplyNewReceiver(address newReceiver);
    event CommitNewAdmin(address admin);
    event ApplyNewAdmin(address admin);
    event SetNewActionDelay(uint256 action_delay);
    event SetNewCallerShare(uint256 caller_share);

    uint256 constant ACTION_DELAY = 15 * 60;
    uint256 constant ADMIN_ACTIONS_DELAY = 3 * 86400;

    uint256 constant PRECISION = 1e18;
    uint256 constant PROFIT_THRESHOLD = 10 ** 18;
    uint256 constant SHARE_PRECISION = 10 ** 5;

    StableSwapPool public immutable POOL;
    uint256 public immutable I; // index of pegged in pool
    address public immutable PEGGED;
    bool public immutable IS_INVERSE;
    uint256 public immutable PEG_MUL;
    IStableSwapLP public LP;
    StableAggregator public immutable AGGREGATOR;

    uint256 public last_change;
    uint256 public debt;
    uint256 public caller_share;

    address public admin;
    address public future_admin;
    address public receiver;
    address public future_receiver;

    uint256 public new_admin_deadline;
    uint256 public new_receiver_deadline;

    // address public immutable FACTORY;

    constructor(
        address _pool, // Contract pool
        uint256 _index, // Index of the pegged
        address _receiver, // REceiver of profit
        uint256 _caller_share, // Caller's share of profit
        // address _factory, // Factory address which should be able to take coins away
        address _aggregator, // Price aggregator which shows the price of the pegged in real "dollars"
        address _lp, // LP token address
        address _admin // Admin address
    ) {
        require(_index < 2, "Index out of range");
        POOL = StableSwapPool(_pool);
        I = _index;
        PEGGED = POOL.coins(_index);
        ERC20(PEGGED).approve(_pool, type(uint256).max);
        // ERC20(PEGGED).approve(_factory, type(uint256).max);
        PEG_MUL = 10 ** (18 - ERC20(POOL.coins(1 - _index)).decimals());
        LP = IStableSwapLP(_lp);

        admin = _admin;
        require(_receiver != address(0), "Receiver is zero address");
        receiver = _receiver;
        emit ApplyNewAdmin(_admin);
        emit ApplyNewReceiver(_receiver);

        require(_caller_share <= SHARE_PRECISION, "Share is too big");
        caller_share = _caller_share;
        emit SetNewCallerShare(_caller_share);

        // FACTORY = _factory;
        AGGREGATOR = StableAggregator(_aggregator);
        IS_INVERSE = (_index == 0);
    }

    // function factory() external view returns (address) {
    //     return FACTORY;
    // }

    function pegged() external view returns (address) {
        return PEGGED;
    }

    function pool() external view returns (StableSwapPool) {
        return POOL;
    }

    function aggregator() external view returns (StableAggregator) {
        return AGGREGATOR;
    }

    function _provide(uint256 _amount) internal {
        // We already have all reserves here
        // ERC20(PEGGED).mint(address(this), _amount);
        if (_amount == 0) {
            return;
        }
        uint256[2] memory amounts;
        amounts[I] = _amount;
        last_change = block.timestamp;
        debt += _amount;
        emit Provide(_amount);
        POOL.add_liquidity(amounts, 0);
    }

    function _withdraw(uint256 _amount) internal {
        if (_amount == 0) {
            return;
        }
        uint256[2] memory amounts;
        amounts[I] = _amount;
        last_change = block.timestamp;
        debt -= _amount;
        emit Withdraw(_amount);

        POOL.remove_liquidity_imbalance(amounts, type(uint256).max);
    }

    function _calc_profit() internal view returns (uint256) {
        uint256 lp_balance = LP.balanceOf(address(this));

        uint256 virtual_price = POOL.get_virtual_price();
        uint256 lp_debt = (debt * PRECISION) / virtual_price + PROFIT_THRESHOLD;

        if (lp_balance <= lp_debt) {
            return 0;
        } else {
            return lp_balance - lp_debt;
        }
    }

    function _calc_future_profit(
        uint256 _amount,
        bool _is_deposit
    ) internal view returns (uint256) {
        uint256 lp_balance = LP.balanceOf(address(this));

        uint256 debt_local = debt;
        uint256 amount_local = _amount;
        if (!_is_deposit) {
            amount_local = min(_amount, debt_local);
        }

        uint256[2] memory amounts;
        amounts[I] = amount_local;
        uint256 lp_balance_diff = POOL.calc_token_amount(amounts, _is_deposit);

        if (_is_deposit) {
            lp_balance += lp_balance_diff;
            debt_local += amount_local;
        } else {
            lp_balance -= lp_balance_diff;
            debt_local -= amount_local;
        }

        uint256 virtual_price = POOL.get_virtual_price();
        uint256 lp_debt = (debt_local * PRECISION) /
            virtual_price +
            PROFIT_THRESHOLD;

        if (lp_balance <= lp_debt) {
            return 0;
        } else {
            return lp_balance - lp_debt;
        }
    }

    function min(uint256 a, uint256 b) internal pure returns (uint256) {
        return a < b ? a : b;
    }

    function calc_profit() external view returns (uint256) {
        return _calc_profit();
    }

    function estimate_caller_profit() external view returns (uint256) {
        if (last_change + ACTION_DELAY > block.timestamp) {
            return 0;
        }

        uint256 balance_pegged = POOL.balances(I);
        uint256 balance_peg = POOL.balances(1 - I) * PEG_MUL;

        uint256 initial_profit = _calc_profit();

        uint256 p_agg = AGGREGATOR.price(); // current USD per stablecoin

        // Checking the balance will ensure no-loss of the stabilizer, but to ensure stabilization
        // we need to exclude "bad" p_agg, so we add an extra check for it
        uint256 new_profit = 0;
        if (balance_peg > balance_pegged) {
            if (p_agg < 10 ** 18) {
                return 0;
            }
            new_profit = _calc_future_profit(
                (balance_peg - balance_pegged) / 5,
                true
            ); // this dumps stablecoin
        } else {
            if (p_agg > 10 ** 18) {
                return 0;
            }
            new_profit = _calc_future_profit(
                (balance_pegged - balance_peg) / 5,
                false
            ); // this pumps stablecoin
        }

        if (new_profit < initial_profit) {
            return 0;
        }
        uint256 lp_amount = new_profit - initial_profit;
        return (lp_amount * caller_share) / SHARE_PRECISION;
    }

    function update(address _beneficiary) external returns (uint256) {
        if (last_change + ACTION_DELAY > block.timestamp) {
            revert("Action delay");
        }

        uint256 balance_pegged = POOL.balances(I);
        uint256 balance_peg = POOL.balances(1 - I) * PEG_MUL;

        uint256 initial_profit = _calc_profit();

        uint256 p_agg = AGGREGATOR.price(); // Current USD per stablecoin

        if (balance_peg > balance_pegged) {
            require(p_agg >= 10 ** 18, "peg unprofitable");
            _provide((balance_peg - balance_pegged) / 5); // this dumps stablecoin
        } else {
            require(p_agg <= 10 ** 18, "peg unprofitable");
            _withdraw((balance_pegged - balance_peg) / 5); // this pumps stablecoin
        }

        uint256 new_profit = _calc_profit();
        require(new_profit >= initial_profit, "peg unprofitable");
        uint256 lp_amount = new_profit - initial_profit;
        uint256 caller_profit = (lp_amount * caller_share) / SHARE_PRECISION;
        if (caller_profit > 0) {
            LP.transfer(_beneficiary, caller_profit);
        }

        return caller_profit;
    }

    function set_new_caller_share(uint256 _new_caller_share) external {
        require(msg.sender == admin, "only admin");
        require(_new_caller_share <= SHARE_PRECISION, "bad part value");

        caller_share = _new_caller_share;

        emit SetNewCallerShare(_new_caller_share);
    }

    function withdraw_profit() external returns (uint256) {
        uint256 lp_amount = _calc_profit();
        LP.transfer(receiver, lp_amount);
        emit Profit(lp_amount);
        return lp_amount;
    }

    function commit_new_admin(address _new_admin) external {
        require(msg.sender == admin, "only admin");
        require(new_admin_deadline == 0, "active action");

        uint256 deadline = block.timestamp + ADMIN_ACTIONS_DELAY;
        new_admin_deadline = deadline;
        future_admin = _new_admin;

        emit CommitNewAdmin(_new_admin);
    }

    function apply_new_admin() external {
        address new_admin = future_admin;
        require(msg.sender == new_admin, "only new admin");

        require(block.timestamp >= new_admin_deadline, "insufficient time");
        require(new_admin_deadline != 0, "no active action");

        admin = new_admin;
        new_admin_deadline = 0;

        emit ApplyNewAdmin(new_admin);
    }

    function commit_new_receiver(address _new_receiver) external {
        require(msg.sender == admin, "only admin");
        require(new_receiver_deadline == 0, "active action");

        uint256 deadline = block.timestamp + ADMIN_ACTIONS_DELAY;
        new_receiver_deadline = deadline;
        future_receiver = _new_receiver;

        emit CommitNewReceiver(_new_receiver);
    }

    function apply_new_receiver() external {
        require(block.timestamp >= new_receiver_deadline, "insufficient time");
        require(new_receiver_deadline != 0, "no active action");

        address new_receiver = future_receiver;
        receiver = new_receiver;
        new_receiver_deadline = 0;

        emit ApplyNewReceiver(new_receiver);
    }

    function revert_new_options() external {
        require(msg.sender == admin, "only admin");

        new_admin_deadline = 0;
        new_receiver_deadline = 0;

        emit ApplyNewAdmin(admin);
        emit ApplyNewReceiver(receiver);
    }
}
